import React from 'react';
import fire from '../fire';
class Home extends React.Component {

  logout() {
    fire.auth().signOut();
  }

  render() {
    return (
      <div style={{textAlign: 'center'}}>
        <h1>You Are Logged In</h1>
        <button onClick = {this.logout}>You have been signed out</button>
      </div>
    )
  }
}

export default Home;
